expressions.shortname:
var s := "format";
s := replace_all(s, 'image/', '');
s := replace_all(s, ';encoder=HugoSmits86', ' hs');
s := replace_all(s, ';encoder=chai2010', ' c');
s := replace_all(s, ';encoder=jack;mem=nrgba', ' j');
s := replace_all(s, ';encoder=jacktra;mem=nrgba', ' jt');
s := replace_all(s, ';quality=', ' ');
s

expressions.latency + size:
var lat := concat(string("latency"), ' ms');
var size := concat(string(round("size" / 1000)), ' KB');
concat(lat, ' ', size)

expressions.name:
var s := "format";
s := replace_all(s, 'image/', '');
s := replace_all(s, ';encoder=', ' ');
s := replace_all(s, ';mem=nrgba', '');
s := replace_all(s, ';quality=', ' q=');
s
